import styled from 'styled-components';

export const Navigation = styled.header`
  padding: 1rem;
  //position: fixed;
  background: #fff;
  width: 100%;
  color: #000;
  font-family: "Kumbh Sans", sans-serif;
`

export const NavMenu = styled.nav`
  display: flex;
  align-items: center;
  margin-right: auto;
`

export const NavLink = styled.a`
    padding: 0.5rem;  

    svg {
      width: 4.3rem;
      color: #397f6e;
    }
`
